I'm using Eclipse RCP in combination with Hibernate. My application consists of several Plug-Ins. Each Plug-In defines its own objectmodel for Hibernate. For that reason I use Eclipse-BuddyPolicy:registered to make the objectmodel classes visible to the Plug-In containing the Hibernate classes. All works pretty fine, but I recognized some performance issues on classloading when using the RegisteredPolicy. The problem is that the policy implementation goes through all registerd bundles until the class/resource was found. My tests have shown that this is a quite time consuming task. To work around this problem I extended the registered policy implementation with a heuristic function which tries to determine the Bundle in those the class/resource is most likely to be found.

Here is the code-fragement I have used for my experiments:

package org.eclipse.osgi.framework.internal.core;
...
public class RegisteredPolicy extends DependentPolicy {
   ...

    public Class loadClass(String name) {

        if (allDependents == null)
            return null;

        Class result = null;

        BundleDescription bd = getBestMatchingBundle(name);
        try {
            if (bd != null) {
                BundleLoaderProxy proxy = buddyRequester.getLoaderProxy(bd);
                if (proxy != null)
                    result = proxy.getBundleLoader().findClass(name, true);
            }
        }
        catch (ClassNotFoundException ex) {
            // we will keep looking
        }

        if (result == null) {
            int size = allDependents.size();
            for (int i = 0; i < size && result == null; i++) {
                try {
                    BundleLoaderProxy proxy = buddyRequester
                        .getLoaderProxy((BundleDescription) allDependents
                            .get(i));
                    if (proxy == null)
                        continue;
                    result = proxy.getBundleLoader().findClass(name, true);
                }
                catch (ClassNotFoundException e) {
                    //Nothing to do, just keep looking
                    continue;
                }
            }
        }
        return result;
    }


    private BundleDescription getBestMatchingBundle(String name) {

        BundleDescription result = null;
        int size = allDependents.size();

        String test = name;
        while(test.indexOf(".") >= 0 && result==null) { //$NON-NLS-1$
            test = test.substring(0, test.lastIndexOf(".")); //$NON-NLS-1$

            for (int i = 0; i < size && result == null; i++) {
                BundleDescription bd = (BundleDescription) allDependents.get(i);
                if(bd.getSymbolicName().startsWith(test)) {
                    result = bd;
                }
            }
        }
        return result;
    }
}


The method getBestMatchingBundle reduces the name of the requested class until a bundle was found which symbolic name starts with the reduced class name. Therfore, if such a bundle could be found, we can locate the class by consulting only one bundle.
Obviously this heruristic function adds many constraints how Plug-Ins and packages should be named so that it can work correctly. By the way, this was only an idea how to improve the perfomance of classloading of the registered bundle policy. Maybe it is possible to provide a heuristic function from outside (eg. unsing the MANIFEST.MF file). 

In my case this simple function significantly improves the performance of the buddy classloading.

I'am not sure, if such an improvement can be implemented and/or it is intedned to be implemented. 

Kind regards
Markus

