The snippet below opens two shells. With the second shell still active, start a drag operation to select some characters in the text field of the first shell.
=> The first mouse down event in the parent shell does not get through to the text widget.

The same problem can be reproduced in an Eclipse Java editor when the Ctrl+O dialog is up.

The problem is in the call to childShell.close() in the body of
new ShellAdapter() {...}.shellDeactivated(..).

A workaround is to close the child shell in an asyncExec (set ASYNC to true). However, I think this bug should be fixed in the SWT layer.


public class CloseModeless {

    static final boolean ASYNC= true;

    public static void main(String[] args) {
        final Display display = new Display();
        final Shell shell = new Shell();
        shell.setLayout(new GridLayout());

        Text text= new Text(shell, SWT.WRAP);
        text.setText("Lorem ipsum dolor sit amet, ...");
        shell.pack();
        shell.open();

        final Shell childShell= new Shell(shell);
        Rectangle b= shell.getBounds();
        childShell.setBounds(b.x + b.width - 20, b.y + b.height - 20, b.width, b.height);
        childShell.open();
        childShell.addShellListener(new ShellAdapter() {
            public void shellDeactivated(ShellEvent e) {
                if (ASYNC) {
                    childShell.getDisplay().asyncExec(new Runnable() {
                        public void run() {
                            childShell.close();
                        }
                    });
                } else {
                    childShell.close();
                }
            }
        });

        while (!shell.isDisposed()) {
            if (!display.readAndDispatch()) {
                display.sleep();
            }
        }
    }
}

