I modified the attached code snippet as follows, now it works.

function beforeDrawAxisLabel( axis, label, context )
{
 importPackage(Packages.java.lang);
 importPackage(Packages.java.util);
 importPackage(Packages.org.eclipse.birt.chart.model.attribute);
 if ( axis.getType() == AxisType.DATE_TIME_LITERAL)
 {
 	var lbl = label.getCaption().getValue();
 	dateTime = new Date(lbl);
 	var dy   = dateTime.getDate();
 	var mth  = dateTime.getMonth() + 1;
 	newLabel = mth + '/' + dy;

	label.getCaption().setValue(newLabel);
 }
}

Notes: "label" equals to axis.getLabel(), so it is not necessary to call axis.getLabel() and axis.setLabel() methods.

