I have two examples of binding keys that do not work with calls to ASTRequestor.createBindings() that do work with ASTParser.createASTs()

Both involve generics(I don't know if this is a requirement).
The first is a member generic type. Given the following source file:

---------------------------------
package test;

import java.util.*;

public class Test {

	public interface ExtraIterator<T> extends Iterator {
		public void extra();
	}

	public class Test2<T> implements ExtraIterator<T> {
	    public boolean hasNext() {
	        return false;
	    }

	    public T next() {
	        return null;
	    }

	    public void remove() {
	    }

	    public void extra() {
	    }
	}
}
--------------------------------------------------------
Asking for the binding for key "Ltest/Test$ExtraIterator<>;" gives the correct binding (the raw type ExtraIterator) from ASTParser, but returns null from ASTRequestor.


The second example is a secondary generic type. Modifying the first example slightly:

---------------------------------------------------------
package test;

import java.util.*;

interface ExtraIterator<T> extends Iterator {
	public void extra();
}

public class Test<T> implements ExtraIterator<T> {
    public boolean hasNext() {
        return false;
    }

    public T next() {
        return null;
    }

    public void remove() {
    }

    public void extra() {
    }
}
--------------------------------------------------------

Again, ASTParser returns the correct binding for the binding key "Ltest/Test~ExtraIterator<>;". Strangely, ASTRequestor returns the binding for test.Test.

